control_panel_key_press = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 2, 66), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setLabel("control-panel-key-press").setMaxAccess("readwrite")
if mibBuilder.loadTexts: control_panel_key_press.setStatus('optional')
if mibBuilder.loadTexts: control_panel_key_press.setDescription('Writing this object simulates pressing a key on the control panel. Reading it will return the last key pressed either on the control panel or via PML. This object obsoletes/replaces CONTROL-PANEL-BUTTON-PRESS object which was unable to represent each of the possible key combinations of our current control panels (ie. Full QWERTY keyboard). The device POS will specify the full range of keys supported by this object. Additional information: >>>>This object is write-only for hw_rom variant but it is read-write for all other variants.<<<<< Writing this object simulates pressing a key on the control panel. Reading it will return the last key pressed either on the control panel or via PML. This object obsoletes/replaces CONTROL-PANEL-BUTTON-PRESS object which was unable to represent each of the possible key combinations of our current control panels (ie. Full QWERTY keyboard). The device POS will specify the full range of keys supported by this object. The LaserJet 9000 implementation of this object supports the Unified Key Encoding Scheme which is documented at http://clbu.boi.hp.com/~kevino/GCPA/keycodes.doc NOTE: Chris is working on an updated version of this scheme which will be referenced once made available.')
faxjob_rx_count = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 3, 3, 1, 2), Integer32()).setLabel("faxjob-rx-count").setMaxAccess("readwrite")
if mibBuilder.loadTexts: faxjob_rx_count.setStatus('optional')
if mibBuilder.loadTexts: faxjob_rx_count.setDescription('This object tracks the number of completed fax jobs received. It counts jobs not individual pages. Counter will increment by one for each job received, no matter the number of pages within the job. The count includes all received jobs including stored jobs. Additional information: This keeps the total number of AFAX jobs received successfully')
faxjob_tx_count = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 3, 3, 3, 2), Integer32()).setLabel("faxjob-tx-count").setMaxAccess("readwrite")
