scan_sharpening_coefficient = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 2, 2, 1, 15), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 6))).setLabel("scan-sharpening-coefficient").setMaxAccess("readwrite")
