scanner_accessory_digital_send_status = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 2, 2, 1, 65), Integer32()).setLabel("scanner-accessory-digital-send-status").setMaxAccess("readonly")
if mibBuilder.loadTexts: scanner_accessory_digital_send_status.setStatus('optional')
if mibBuilder.loadTexts: scanner_accessory_digital_send_status.setDescription('This item is used for detecting the status of the Digital Send component. A bit-mask indicates the status as follows: 0x00 = READY 0x01 = DIGITAL_SEND_GATEWAY_DOWN 0x02 = SMTP_GATEWAY_DOWN 0x04 = LDAP_GATEWAY_DOWN. Additional information: This item is used for detecting the status of the Digital Send component. A bit-mask indicates the status of a particular connection: bit 0 = DIGITAL_SEND_SERVICE status bit 1 = SMTP (Email) Gateway status bit 2 = LDAP (Addressing) Gateway status bit 3 = JetDirect card status bit 4 = Analog Fax status If the particular bit is SET (1) in the value returned from the PML query, that means the connection is DOWN. An UNSET bit (0) indicates the connection is UP. Ex: Assume 65509 is returned from the PML query 65509 translates to 0xFFE5 Looking at 0xE5 => 1110 0101 This tells me that bits 1,3 and 4 are NOT set, so those connections are UP. SMTP, JetDirect and Fax are UP. DIGITAL SEND SERVICE, and LDAP are DOWN.')
