scan_calibration_download = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 2, 2, 2, 5), OctetString()).setLabel("scan-calibration-download").setMaxAccess("readwrite")
if mibBuilder.loadTexts: scan_calibration_download.setStatus('optional')
if mibBuilder.loadTexts: scan_calibration_download.setDescription('Returns or changes the state of the calibration operation. cScanCalibrationIdle - This indicates that the device is not currently processing a calibration request. The host should not set the object to this state. SCAN-CALIBRATION-ERROR state will reflect results of most recent calibration. cScanCalibrationActive - The device sets this state to indicate it is in calibration mode. The device will set SCAN-CALIBRATION-ERROR to eNoError(1) as a consequence of entering this state. cScanCalibrationOptical - This state is set by the host to request factory optical calibration initiation. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationADFFaceUpMechanical - This state is set by the host to request factory face up ADF mechanical calibration initiation. The calibration target should be placed face up in the ADF. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationADFFaceDownMechanical - This state is set by the host to request factory facedown ADF mechanical calibration initiation. The calibration target should be placed facedown in the ADF. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationFBMechanical - This state is set by the host to request factory flat bed mechanical calibration initiation. The device should not set to this state. The device will ignore this request, without error, if it is already in theactive state. cScanCalibrationADFResetMechanical - This state is set by the host if he wants to start ADF mechanical calibration all over again. If this is set then both Face Up and Face Down calibration can be started even after a successful pass. The device will NOT print a calibration graph when calibration is complete. Additional information: Returns or changes the state of the calibration operation. cScanCalibrationIdle - This indicates that the device is not currently processing a calibration request. The host should not set the object to this state. SCAN-CALIBRATION-ERROR state will reflect results of most recent calibration. cScanCalibrationActive - The device sets this state to indicate it is in calibration mode. The device will set SCAN-CALIBRATION-ERROR to eNoError(1) as a consequence of entering this state. cScanCalibrationOptical - This state is set by the host to request factory optical calibration initiation. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationADFFaceUpMechanical - This state is set by the host to request factory face up ADF mechanical calibration initiation. The calibration target should be placed face up in the ADF. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationADFFaceDownMechanical - This state is set by the host to request factory face down ADF mechanical calibration initiation. The calibration target should be placed face down in the ADF. The device should not set to this state. The device will ignore this request, without error, if it is already in the active or the done state. cScanCalibrationFBMechanical - This state is set by the host to request factory flat bed mechanical calibration initiation. The device should not set to this state. The device will ignore this request, without error, if it is already in the active state. cScanCalibrationADFResetMechanical - This state is set by the host if he wants to start ADF mechanical calibration all over again. If this is set then both Face Up and Face Down calibration can be started even after a successful pass. The device will NOT print a calibration graph when calibration is complete. ')
