if mibBuilder.loadTexts: scan_calibration_error.setStatus('optional')
if mibBuilder.loadTexts: scan_calibration_error.setDescription('Error status of the most recent calibration session. eNoError(1) - The calibation was successful. eUnknownCalibrationError(2) - An unknown error occurred. eScannerFeederEmpty(3) - The feeder contained nothing to scan. eLowMemory(4) - Insufficient memory available to complete the calibration. eWriteFailed(5) - Write to NVRAM failure. eScannerBusy(6) - Scanner is busy. Detailed information about the cause and remedy for each error should be documented in the device POS. Additional information: Error status of the most recent calibration session. Only eNoError, eScannerBusy, and eUncorrectablePixels will be supported. The device will use eScannerBusy to indicate the calibration request occurred during a time that the device was not ready to perform calibration. The device will use eUncorrectablePixels to indicate that at least one pixel was not correctable on at least one of scanning sensors in the device (ADF or flatbed).')
