if mibBuilder.loadTexts: file_system_set_system_partition_writeable.setDescription('This object allows the device-system partition to be written to. It consists of a C structure containing the following fields: typedef struct { ubyte <<hidden>>[8]; ubyte volumenumber; } fs_writeable_system_partition_t; which is described below: Bytes 0 - 7: contain the <<hidden>> Byte 8 : is the volume number Access to this command is controlled by the <<hidden>>. If the <<hidden>> supplied is incorrect the command will fail. The volumenumber is a volume number of an existing device-system partition. Additional information: Returns <noSuchName> status if attempting to access this object and there is no storage device is installed. Returns <badValue> if the <<hidden>> is incorrect or if the volume requested is not present.')
file_system_set_system_partition_readonly = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 10, 1, 7), Integer32()).setLabel("file-system-set-system-partition-readonly").setMaxAccess("writeonly")
