if mibBuilder.loadTexts: marker_density_calibration.setDescription('Returns the calibration status or triggers a calibration cycle. All calibration procedures are used if set to eCalibrateALL. If set to eCalibrateColor then a full density engine calibration is triggered. If set to eCalibrateHalftone, then a Halftone calibration is triggered. If set to eCalibrateColorPlaneRegistration, then a Color Plane Registration calibration is triggered. If set to eCalibrateDrumPhaseAdjustment, then a Drum Phase Adjustment calibration is triggered.If set to eCalibrateLowSpeedColor, then a Low Speed Color calibration is triggered.If set to eCalibrateDrumSpeedAdjustment, then a Drum Speed Adjustment calibration is triggered.If set to eCalibrateNeutrals, then a Gray Axis Control calibration is triggered. Additional information: Returns the calibration status or triggers a calibration cycle. All calibration procedures are used if set to eCalibrateALL. If set to eCalibrateColor then a full density engine calibration is triggered. If set to eCalibrateHalftone, then a Halftone calibration is triggered. If set to eCalibrateColorPlaneRegistration, then a Color Plane Registration calibration is triggered. If set to eCalibrateDrumPhaseAdjustment, then a Drum Phase Adjustment calibration is triggered.')
