if mibBuilder.loadTexts: supplies_replace_action_at_setting.setDescription('This object can be used to change the setting of menu item REPLACE SUPPLIES. The behavior of the printer when a supply reaches low changes in accordance with the setting of this PML Object. If the option eStopAtLow is selected printer will stop when a supply reaches LOW. If the option eStopAtOut is selected then printer will stop when a supply reaches OUT. If the options eStopAtMaxLife (supported only on Mono products) is selected, the printer will continue past supply OUT. If the option eOverrideAtOut or eOverrideAtOut2 (supported only on Color products) is selected then printer will continue past OUT in override mode. This option is not writeable. That is using this PML object the setting could be changed to any option other than eOverrideAtOut and eOverrideAtOut2. Additional information: This PML object can be used to change the setting of the menu item REPLACE SUPPLIES. The behavior of the printer when a supply hits low changes in accordance with the setting of this PML Object. 1. eStopAtLow - Printer will stop when a supply reaches low. 2. eStopAtOut - Printer will stop when a supply reaches out. 3. eOverrideAtOut[Read-only, Color Products] - Printer will continue print past out in override mode.')
