if mibBuilder.loadTexts: cartridge_out_override_control.setDescription('This PML object is used to control Cartridge Out Override feature. Additional information: This object is used for the following purposes: 1. Enable/disable cartridge out override through SUPPLIES_REPLACE_ACTION_AT_PML Object. 2. Enable/disable Toner Out Limit: When toner out limit is disabled using this PML Object, engine will not be taken offline when a cartridge reaches toner out. Engine will continue to print and will be in Override mode until other limits are reached. 3. Enable/disable CRG R&D Limit: When CRG R&D limit is disabled using this PML Object, engine will not be taken offline when CRG R&D limit for printing in override is reached for any out cartridge. Engine will continue to print and will be in Override mode until other limits are reached.')
