if mibBuilder.loadTexts: supply_out_device_state.setDescription('This PML object indicates the current behavior of the device if one or more supplies have reached out. If no supply has reached out, the value of this PML object is eNoSupplyOut. If one or more supplies have reached out, the value of this PML object will indicate if the printer is online and if so what mode is being used to continue printing. Additional information: This object indicates the current behavior of the device if one or more supplies have reached out. The enums represent: eNoSupplyOut - No supplies have reached out. eOffline - Printer is offline since one or more supplies have reached out. eSupplyOutOverride - The supply override out is active. eMonochromePrintingAfterColorCartridgeOut - Monochrome printing after a color supply out is active.')
