if mibBuilder.loadTexts: consumable_notification_status.setStatus('optional')
if mibBuilder.loadTexts: consumable_notification_status.setDescription("This object is used to read and write the various status flags supported by this consumable. For Laserjet 4700 MFP the collection bits supported include: cClient1ReorderNotificationSent - indicates whether EWS (Embedded Web Server) has already sent the reorder notification e-mail for this consumable. This bit can be both read and written. cClient2ReorderNotificationSent - indicates whether WJA (Web Jet Admin) has already sent the reorder notification e-mail for this consumable. This bit can be both read and written. cClient3ReorderNotificationSent - for future implementation cClient4ReorderNotificationSent - for future implementation cClient5ReorderNotificationSent - for future implementation cClient1ReplaceNotificationSent - indicates whether EWS (Embedded Web Server) has already sent the replace notification e-mail for this consumable. This bit can be both read and written. cClient2ReplaceNotificationSent - indicates whether WJA (Web Jet Admin) has already sent the replace notification e-mail for this consumable. This bit can be both read and written. cClient3ReplaceNotificationSent - for future implementation cClient4ReplaceNotificationSent - for future implementation cClient5ReplaceNotificationSent - for future implementation Additional information: If the cartridge is deemed to be NonHP, then this object will not exist. This object will have 1 sub arrays for the consumable. The client1 and 2 currently are assingned to EWS and WJA the remaining client are reserved for the future third party pml tools. A client is requiered to set only his assigned bit for reorder or replace notification. A client using other client's bit for reorder replace will result in the other client being not able to set the notification. Ex: For EWS ReOrderNotification it will send 0x00010000 and For EWS ReplaceNotification it will send 0x00000001 For WJA ReOrderNotification it will send 0x00020000 and For WJA ReplaceNotification it will send 0x00000002")
